    };

    return (
        <form onSubmit={handleSubmit(onSubmit)}>
        <input
          name="email"
          placeholder="example@domain.com"
          ref={register()}
        />
        {errors.email && errors.email.message}

        <label>Password</label>
        <input
          name="password"
          placeholder="••••••••••"
          ref={register()}
        />
        {errors.email && errors.email.message}

        <button type="submit">Submit</button>
      </form>
    )
}

